import logo from "./logo.svg";
import "./App.css";
import { render } from "@testing-library/react";
import Tarjeta from "./components/Tarjeta";
import Toggle from "./components/Toggle";

function Body() {
  return <h2>This is a body element</h2>;
}

function App() {
  return (
    <div>
      <Tarjeta titulo="Axel" descripcion="Esta es una descripcion" />
      <Tarjeta titulo="Rica" descripcion="Esta es una descripcion" />
      <Tarjeta titulo="Azule" descripcion="Esta es una descripcion" />
      <Toggle />
    </div>
  );
}

export default App;
